import './App.css';
import Header from './Header';

const arrayList = ['Acordar cedo', 'Fazer café', 'Programar', 'Chorar', 'Banho', 'Dormir!', 'Cagar', 'Comer'];

const Task = (value) => {
  return (
    <li className='item-list'>{value}</li>
  );
}

const listTask = () => {
  return (
    arrayList.map((tarefa) => {
      return Task(tarefa)})
  )
}


function App() {
  return (
    <div className='list-tasks'>
    < Header />
    <ol className='ol-list'>{listTask()}</ol>
    </div>
  )
}

export default App;
